import linkedin from './linkedin-logo.png'
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';


function SocialNetwork(){
    const theme1 = createTheme({
        typography: {
          fontFamily: [
            '-apple-system',
            'BlinkMacSystemFont',
          '"Segoe UI"',
          'Roboto',
          '"Helvetica Neue"',
          'Arial',
          'sans-serif',
          '"Apple Color Emoji"',
          '"Segoe UI Emoji"',
          '"Segoe UI Symbol"',
          ].join(','),
        },
      });
    return(
        <>
            <div className="row display-5 justify-content-center">
            <ThemeProvider theme={theme1}></ThemeProvider>
                You can reach me here :)
            </div>
            <div className="row">
                <div className='col'>
                    <a href='https://www.linkedin.com/in/mohan-kumar-r/' target="_blank" rel="noopener noreferrer"><img src={linkedin}  style={{width:"10vh"}}></img></a>                 
                </div>
                <div className='row'>
                    
                </div>
              
            </div>
        </>
    );
   
}

export default SocialNetwork;
